import React from "react";

const Navbar = () => {
  return (
    <div className="ui inverted segment">
      <div className="ui large secondary inverted pointing menu">
        <a href="/" className="active item">
          Main
        </a>
        <a href="/" className="item">
          My Blogs
        </a>
        <a href="/" className="item">
          Create
        </a>
      </div>
    </div>
  );
};

export default Navbar;
